// import StarFull from "../../images/starFull.svg";
// import StarEmpty from "../../images/starEmpty.svg";

export default function Rating(props) {

    const ratings = Number(props.data);

    let stars = []

    for(let i = 0; i < ratings; i++) {
        stars.push("oui")
    }

    return (
        <div>
            <p>
                {stars}
            </p>
        </div>
    )
}
